import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import { SplunkThemeProvider } from '@splunk/themes';
import Navbar from './components/Navbar';
import FormBuilder from './components/FormBuilder';
import ViewForms from './components/ViewForms';
import Configuration from './components/Configuration';
import FormDisplay from './components/FormDisplay';
import Login from './components/Login';
import CreateUser from './components/CreateUser';
import ResetPassword from './components/ResetPassword';
import GrantPermissions from './components/GrantPermissions';
import AdminPage from './components/AdminPage';

const App = () => {
    const [isAuthenticated, setIsAuthenticated] = useState(
        !!localStorage.getItem('token') // Check if token exists in localStorage
    );
    const [userRole, setUserRole] = useState(''); // Track user role
    const [username, setUsername] = useState(''); // Track username

    const handleLogin = (role, user) => {
        setIsAuthenticated(true);
        setUserRole(role); // Set user role on login
        setUsername(user); // Set username on login
        console.log('User logged in with role:', role);
    };

    const handleLogout = () => {
        localStorage.removeItem('token'); // Remove token to log out
        setIsAuthenticated(false);
        setUserRole(''); // Reset user role on logout
        setUsername(''); // Reset username on logout
        console.log('User logged out');
    };

    return (
        <SplunkThemeProvider family="enterprise" density="comfortable">
            <Router>
                <Navbar isAuthenticated={isAuthenticated} onLogout={handleLogout} username={username} />
                <div className="content">
                    <Routes>
                        <Route path="/" element={<Navigate to={isAuthenticated ? "/view-forms" : "/login"} />} />
                        <Route path="/login" element={isAuthenticated ? <Navigate to="/view-forms" /> : <Login onLogin={handleLogin} />} />
                        <Route
                            path="/view-forms"
                            element={isAuthenticated ? <ViewForms userRole={userRole} /> : <Navigate to="/login" />}
                        />
                        {/* Conditional rendering based on user roles */}
                        <Route
                            path="/form-builder"
                            element={isAuthenticated && (userRole === 'admin' || userRole === 'developer') ? <FormBuilder /> : <Navigate to="/login" />}
                        />
                        <Route
                            path="/configuration"
                            element={isAuthenticated && userRole === 'admin' ? <Configuration /> : <Navigate to="/login" />}
                        />
                        <Route
                            path="/admin"
                            element={isAuthenticated && userRole === 'admin' ? <AdminPage /> : <Navigate to="/login" />}
                        />
                        <Route
                            path="/create-user"
                            element={isAuthenticated && userRole === 'admin' ? <CreateUser /> : <Navigate to="/login" />}
                        />
                        <Route
                            path="/reset-password"
                            element={isAuthenticated && userRole === 'admin' ? <ResetPassword /> : <Navigate to="/login" />}
                        />
                        <Route
                            path="/grant-permissions"
                            element={isAuthenticated && userRole === 'admin' ? <GrantPermissions /> : <Navigate to="/login" />}
                        />
                        {/* Allow read-only, admin, and developer roles to access any form */}
                        <Route
                            path="/forms/:formName"
                            element={
                                isAuthenticated 
                                    ? ['admin', 'developer', 'read_user'].includes(userRole)
                                        ? <FormDisplay />
                                        : <Navigate to="/view-forms" />
                                    : <Navigate to="/login" />
                            }
                        />
                    </Routes>
                </div>
            </Router>
        </SplunkThemeProvider>
    );
};

export default App;
